I am using `twitter_oauth2_pkce` and authorizing a user that is different from my developer account.
I then use the access token as the bearer token but when I tweet, it tweets on my developer account instead of the authorized account.
The documentation isn't clear at all on authorizing other users. Please help me figure it out and I'll contribute to the documentation. 🙌 

### authorization:
```dart
Future<void> authTwitterTry2() async {
    final oauth2 = TwitterOAuth2Client(
      clientId: "my client id,
      clientSecret: "my client secret",
      redirectUri: "redirect url,
      customUriScheme: "scheme",
    );
    try {
      final response = await oauth2.executeAuthCodeFlowWithPKCE(scopes: Scope.values);
      print("$response");
      sendTweet(
        response.accessToken,
        response.refreshToken,
      );

    } catch (e, s) {
      print("$e\n$s");
    }
  }
```

### tweet
```dart
  Future<void> sendTweet(String token, String? refreshToken) async {
    final twitterAuth = twitter.TwitterApi(
      bearerToken: token, // This is the token from the authoization
      oauthTokens: const twitter.OAuthTokens(
        consumerKey: "my api key",
        consumerSecret: "my api secret key",
        accessToken: "my access token",
        accessTokenSecret: "my secret access token",
      ),
    );

    try {
      final me = await twitterAuth.users.lookupMe(); //keeps giving me my developer account!
      print("$me");
      final response = await twitterAuth.tweets.createTweet( //Tweets on my developer account
        text: 'Testing an upload from an app',
      );
      print("$response");
    } catch (exception, stackTrace) {
      print("$exception\n$stackTrace");
    }
  }
```

